import React, {useEffect} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'
import styles from "./views/styles/navbar.module.css";
import Image from "next/image";
import NavB from "./views/components/navBar";

const HomePage =()=> {

    useEffect(()=>{
        localStorage.clear();

    },[]);

    return (
            <div className={styles.orden}>
                <Image className={styles.fondo}
                       src="../public/assets/fondo.jpg"
                       alt="imagen"
                       layout="fill"
                />
                <NavB/>
            </div>
    )

}


export default HomePage;
